import React from "react";
import './SoftwareDevelopment.css';
import "@fontsource/red-hat-display";
import './../min.css';
import architecture_design from './resources/architecture_design.svg';
import devops from './resources/devops.svg';
import services from './resources/services.svg';
function DevOps(){
    return(
        <>

        <div style={{"width":"100%","text-align":"center"}}>
        <h1>DevOps Automation</h1>
        <div className="row">
            <div className="box" style={{"box-shadow":"none"}}>
                    <img src={devops}/>
                </div>
                <div className="box" style={{"box-shadow":"none"}}>
                    <div>
                    <img src={services}/>
                    <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.  Lorem Ipsum has been the industry's standard dummy text ever since the 1500</p>
                    <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>

                    </div>
                </div>

                <div className="box" style={{"box-shadow":"none"}}>
                <h1>Platforms</h1>

                    <ol>
                        <li className="bg-image">We’ll prepare a proposal</li>
                        <li className="bg-black">We’ll prepare a proposal</li>
                        <li className="bg-black">We’ll prepare a proposal</li>

                    </ol>
                </div>
           </div>
        </div>
        </>

    );


}
export default DevOps;
